import React from 'react';

import LoggedIn from './loggedin';
import LoggedOut from './loggedout';

export default class Chef extends React.Component {
    constructor(props) {
        super(props);
    
        this.state = {
            username: '',
        };
    }

    
 
  
    render() {   
        return (
            <div className="profile-page">
                <div id="close-profile">x</div>
                <div className="logged-in">
                    <p>Logged in as:</p>
                    <p className="chef">Chef <span className="current-username bold">Francisca</span></p>
                    <button type="button" name="Log Out">Log Out</button>
                </div>
                <div className="logged-out">
                    <h2>Who's the chef?</h2>
                    <input className="username-input" type="text" maxlength="16" name="username" placeholder="Username" />
                    <div className="log-in-options">
                        <button className="log-in">Log In</button>
                        <p> or </p>
                        <button className="log-out">Create Profile</button>
                    </div>
                </div>
            </div>
        );
    }
}
